import React from "react";
import Typewriter from "typewriter-effect";

const Gitwrite = () => {
  return (
    <div style={{ paddingTop: "50px", paddingLeft: "80px" }}>
      <Typewriter
        options={{
          autoStart: true,
          loop: true,
        }}
        onInit={(typewriter) => {
          typewriter
            .typeString("A simple yet powerful native javascript")
            .pauseFor(300)
            .deleteChars(10)
            .typeString(
              "<strong><br/>Site</strong> plugin for a cool typewriter "
            )
            .typeString(
              ' effect and<br/><strong>Just <span style="color: #27ae60;">5kb</span></strong>'
            )
            .pauseFor(1000)
            .start();
        }}
      />
    </div>
  );
};

export default Gitwrite;
